import { useState } from "react";
import { useNavigate } from "react-router-dom";

export default function NearbyFinder() {
  const [query, setQuery] = useState("");
  const [results, setResults] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const navigate = useNavigate();

  const fetchNearby = async (lat, lon) => {
    setLoading(true);
    setError("");
    setResults([]);

    try {
      const overpassQuery = `
        [out:json];
        (
          node["amenity"="hospital"](around:8000,${lat},${lon});
          node["amenity"="clinic"](around:8000,${lat},${lon});
          node["amenity"="pharmacy"](around:8000,${lat},${lon});
        );
        out body;
      `;

      const response = await fetch(
        "https://overpass.kumi.systems/api/interpreter",
        {
          method: "POST",
          headers: {
            "Content-Type": "text/plain",
            "User-Agent": "AI-Health-Assistant/1.0",
          },
          body: overpassQuery,
        }
      );

      const data = await response.json();

      const formatted = data.elements.map((el) => ({
        name: el.tags?.name || "Unknown",
        address:
          el.tags?.["addr:full"] ||
          el.tags?.["addr:street"] ||
          "Address not available",
        phone: el.tags?.phone || "Phone not available",
        lat: el.lat,
        lon: el.lon,
        type: el.tags?.amenity || "hospital",
      }));

      setResults(formatted);
    } catch (err) {
      setError("Failed to fetch nearby places. Please try again.");
    } finally {
      setLoading(false);
    }
  };

  const findNearby = async () => {
    if (!query.trim()) return;

    try {
      const geoRes = await fetch(
        `https://nominatim.openstreetmap.org/search?format=json&q=${query}`
      );
      const geoData = await geoRes.json();

      if (!geoData.length) {
        setError("Location not found");
        return;
      }

      fetchNearby(geoData[0].lat, geoData[0].lon);
    } catch {
      setError("Failed to locate area");
    }
  };

  const useMyLocation = () => {
    if (!navigator.geolocation) {
      setError("Geolocation not supported");
      return;
    }

    navigator.geolocation.getCurrentPosition(
      (pos) => {
        fetchNearby(pos.coords.latitude, pos.coords.longitude);
      },
      () => {
        setError("Location permission denied");
      }
    );
  };

  const openInAppMap = (item) => {
    navigate("/map", {
      state: {
        hospital: item,
      },
    });
  };

  return (
    <div style={{ padding: "20px" }}>
      <h2>Nearby Doctor / Hospital Finder</h2>

      <input
        type="text"
        placeholder="Enter city / area / pincode"
        value={query}
        onChange={(e) => setQuery(e.target.value)}
        style={{ width: "100%", padding: "10px", marginBottom: "10px" }}
      />

      <button onClick={findNearby} style={{ marginRight: "10px" }}>
        Find Nearby
      </button>

      <button onClick={useMyLocation}>Use My Location</button>

      <p style={{ fontSize: "12px", marginTop: "8px" }}>
        Location and distance shown are approximate.
      </p>

      {loading && <p>Loading...</p>}
      {error && <p style={{ color: "red" }}>{error}</p>}

      {results.map((item, index) => (
        <div
          key={index}
          style={{
            border: "1px solid #ddd",
            padding: "12px",
            marginBottom: "12px",
            borderRadius: "8px",
          }}
        >
          <strong>{item.name}</strong>
          <p>{item.address}</p>
          <p>{item.phone}</p>

          <a
            href={`https://www.google.com/maps/dir/?api=1&destination=${item.lat},${item.lon}`}
            target="_blank"
            rel="noreferrer"
            style={{ marginRight: "10px" }}
          >
            Open in Maps
          </a>

          <button onClick={() => openInAppMap(item)}>View on App Map</button>
        </div>
      ))}
    </div>
  );
}
